import React from "react";
import { useEffect } from "react";
import "./Main.css";

const Main = () => {
  useEffect(() => {
    const boxes = document.querySelectorAll(".box");
    const options = {
      root: null,
      threshold: 0.1,
    };

    const handleIntersection = (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add("slide-in");
        }
      });
    };

    const observer = new IntersectionObserver(handleIntersection, options);
    boxes.forEach((box) => observer.observe(box));

    return () => {
      boxes.forEach((box) => observer.unobserve(box));
    };
  }, []);

  return (
    <main
      id="main"
      className="flex flex-col py-32 px-30 pb-[219px] justify-center items-center bg-customBlue overflow-hidden relative lg:flex-row"
    >
      <div className="flex flex-col gap-12 w-[80%] z-10 lg:w-[80%]">
        {/* First Heading */}
        {/* <div className="text-center lg:text-left px-8 lg:px-0 w-full">
          <h2 className="font-bold text-3xl text-textBlue">
            Unlocking the Future of Dementia Detection
          </h2>
          <p className="mt-2 text-lg">Welcome to Our Research Hub!</p>
        </div> */}
        <div className="flex flex-col items-center pl-40 ml-20 ">
          <div className="text-center lg:text-center w-full max-w-2xl">
            <h2 className="font-bold text-3xl text-textBlue">
              Unlocking the Future of Dementia Detection
            </h2>
            <p className="mt-2 text-lg">Welcome to Our Research Hub!</p>
          </div>

          {/* Additional Content (e.g., Boxes) */}
        </div>

        {/* Alternate Boxes */}
        <div className="box bg-white shadow-lg rounded-lg p-8 pl-10 text-center lg:text-left w-full lg:w-[90%] mx-auto h-64">
          <h2 className="font-bold text-3xl text-textBlue">Why It Matters</h2>
          <p className="mt-4  text-xl">
            Imagine a world where advanced technology empowers us to detect
            dementia in its earliest stages where individuals and families
            receive the support they need when it matters most. That’s our
            mission!
          </p>
        </div>

        <div className="box bg-gray-100 shadow-lg rounded-lg p-8 text-center lg:text-left w-full lg:w-[90%]">
          <h2 className="font-bold text-2xl text-textBlue">
            Our Innovative Approach
          </h2>
          <p className="mt-2 text-lg">
            We harness deep learning and machine learning techniques to
            revolutionize dementia detection using a specialized Convolutional
            Neural Network (CNN) powered by TensorFlow and Keras.
          </p>
        </div>

        <div className="box bg-white shadow-lg rounded-lg p-8 text-center lg:text-left w-full lg:w-[90%]">
          <h2 className="font-bold text-2xl text-textBlue">How We Do It</h2>
          <p className="mt-2 text-lg">
            Our approach combines rigorous exploratory data analysis with
            advanced data preprocessing techniques to ensure optimal
            performance.
          </p>
        </div>

        <div className="box bg-gray-100 shadow-lg rounded-lg p-8 text-center lg:text-left w-full lg:w-[90%]">
          <h2 className="font-bold text-2xl text-textBlue">
            Join Us on This Journey!
          </h2>
          <p className="mt-2 text-lg">
            Explore our findings, learn about our methodology, and engage with
            our community. Together, we can make significant strides in
            addressing the global challenge of dementia.
          </p>
        </div>
      </div>

      <div className="z-10">
        <img
          className="h-[300px] w-[300px]"
          src="/brain.png"
          alt="Brain Image"
        />
      </div>

      <div className="primary-color-border primary-color-[100] absolute -left-56 top-20 h-[400px] w-[400px] rounded-full border-[60px] border-blue-100"></div>
      <div className="primary-color-border primary-color-[100] absolute -right-56 top-60 h-[400px] w-[400px] rounded-full border-[60px] border-blue-100"></div>
    </main>
  );
};

export default Main;
